import React from "react";

function Donate() {
    return (
        <section id="donate" className="section animated bounceInUp">
            <h2>Donate</h2>
            <p>
                Every contribution directly supports our projects, enabling more students to access quality
                educational resources.
            </p>
            <a href="/donate" className="cta-btn">
                Donate Now
            </a>
        </section>
    );
}

export default Donate;
